import React, { Component } from "react";
import Calendar from "react-calendar";

class CalendarForm extends Component {
  render() {
    return (
      <div>
        <Calendar ref={(ref) => (this.value = ref)} />
      </div>
    );
  }
}

export default CalendarForm;
